import React, { useState } from 'react';
import './SearchProperty.css';

const SearchProperty = ({ onSearch }) => {
  const [searchCriteria, setSearchCriteria] = useState({
    propertyType: '',
    priceFrom: '',
    priceTo: '',
    location: 'Россия',
    city: '',
    realtor: 'Пакунова Нина Викторовна',
  });

  const handleChange = (e) => {
    const { name, value } = e.target;
    setSearchCriteria({
      ...searchCriteria,
      [name]: value,
    });
  };

  const handleSubmit = (e) => {
    e.preventDefault();
    onSearch(searchCriteria);
  };
  const filterProperties = (criteria) => {
    const filtered = properties.filter(property => {
      const matchesSearchCriteria =
        (!criteria.city || property.location === criteria.city) &&
        (!criteria.priceFrom || parseInt(property.price) >= parseInt(criteria.priceFrom)) &&
        (!criteria.priceTo || parseInt(property.price) <= parseInt(criteria.priceTo)) &&
        (!criteria.propertyType || property.title.toLowerCase().includes(criteria.propertyType.toLowerCase()));
      return matchesSearchCriteria;
    });
    setFilteredProperties(filtered);
  };

  const handleTitleClick = (property) => {
    setSelectedProperty(property);
    setIsOpen(true);
  };

  const handleCloseForm = () => {
    setIsOpen(false);
    setSelectedProperty(null);
  };
  const [selectedProperty, setSelectedProperty] = useState(null);
  const [isOpen, setIsOpen] = useState(false);
  const [filteredProperties, setFilteredProperties] = useState([]); // State to store filtered properties

  const properties = [
    {
      id: 1,
      title: 'Южный квартал',
      description: 'Просторный дом с видом на океан',
      price: '15000000 рублей',
      location: 'Владивосток',
      image: '/house-1.jpg',
    },
    {
      id: 2,
      title: 'Дом у реки',
      description: 'Уютный дом с садом возле реки',
      price: '6 000 000 рублей',
      location: 'Артем',
      image: '/house-2.jpg',
    },
  ];

  return (
    <div className="search-property">
      <h2>Поиск недвижимости</h2>
      <form onSubmit={handleSubmit}>
        <div className="form-group">
          <label htmlFor="propertyType">Тип недвижимости:</label>
          <select
            id="propertyType"
            name="propertyType"
            value={searchCriteria.propertyType}
            onChange={handleChange}
          >
            <option value="">Выберите тип</option>
            <option value="apartment">Квартира</option>
            <option value="house">Дом</option>
            <option value="land">Земля</option>
          </select>
        </div>
        <div className="form-group">
          <label htmlFor="priceFrom">Цена от:</label>
          <input
            type="text"
            id="priceFrom"
            name="priceFrom"
            value={searchCriteria.priceFrom}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="priceTo">Цена до:</label>
          <input
            type="text"
            id="priceTo"
            name="priceTo"
            value={searchCriteria.priceTo}
            onChange={handleChange}
          />
        </div>
        <div className="form-group">
          <label htmlFor="city">Город:</label>
          <select
            id="city"
            name="city"
            value={searchCriteria.city}
            onChange={handleChange}
          >
            <option value="">Выберите город</option>
            <option value="Артем">Артем</option>
            <option value="Владивосток">Владивосток</option>
            <option value="Уссурийск">Уссурийск</option>
            <option value="Находка">Находка</option>
          </select>
        </div>
        <button type="submit">Искать</button>
      </form>
    </div>
  );
};

export default SearchProperty;
